import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';

export default function McDonaldsMenu({ navigation }) {
  return (
    <View style={styles.container}>
      <Text style={styles.sectionTitle}>Menu</Text>
      <TouchableOpacity
        style={styles.foodItem}
        onPress={() => {
          navigation.navigate('FoodItemDetails', {
            item: { name: 'Big Mac' },
          });
        }}
      >
        <Text style={styles.foodItemName}>Big Mac</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.foodItem}
        onPress={() => {
          navigation.navigate('FoodItemDetails', {
            item: { name: 'Chicken McNuggets' },
          });
        }}
      >
        <Text style={styles.foodItemName}>Chicken McNuggets</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.foodItem}
        onPress={() => {
          navigation.navigate('FoodItemDetails', {
            item: { name: 'Quarter Pounder' },
          });
        }}
      >
        <Text style={styles.foodItemName}>Quarter Pounder</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.foodItem}
        onPress={() => {
          navigation.navigate('FoodItemDetails', {
            item: { name: 'French Fries' },
          });
        }}
      >
        <Text style={styles.foodItemName}>French Fries</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 20,
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  foodItem: {
    backgroundColor: '#fff',
    padding: 15,
    marginBottom: 10,
    borderRadius: 8,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.3,
    shadowRadius: 2,
    elevation: 2,
  },
  foodItemName: {
    fontSize: 18,
  },
});
